import React from 'react';
import ReactDOM from 'react-dom';
import SeasonDisplay from './SeasonDisplay' 


const App = () => {
    return (
        <SeasonDisplay>
            <div>Hi there</div>
        </SeasonDisplay>
    );
};


ReactDOM.render(<App />, document.querySelector('#root'));
